import React from "react";
import "../Navigation/Navigation_2.scss";
import {Navbar} from 'react-bootstrap';
import {Nav} from 'react-bootstrap';
class Navigation_2 extends React.Component {
  render() {
    return (
      <div>

<Navbar bg="light" variant="light">
    <Navbar.Brand href="#home">Overview</Navbar.Brand>
    <Nav className="mr-auto">
      <Nav.Link href="#home">Account Info</Nav.Link>
      <Nav.Link href="#features">Orders</Nav.Link>
      <Nav.Link href="#pricing">Refunds</Nav.Link>
      <Nav.Link href="#home">Message Center</Nav.Link>
      <Nav.Link href="#features">Track Order</Nav.Link>
      <Nav.Link href="#pricing">Statistic</Nav.Link>
      <Nav.Link href="#home">Help</Nav.Link>
      <Nav.Link href="#features">Orders</Nav.Link>
      <Nav.Link href="#pricing">Refunds</Nav.Link>
    </Nav>
    
  </Navbar>


        </div>
    );
  }
}

export default Navigation_2;
